def EdgeInfo(n, graph):
    i = 0
    for arr in graph['pos']:
        i += 1
        refNode = {}
        tarNode = {}
        for link in graph['links']:
            if int(link['id']) == int(arr['reference']):
                for node in graph['nodes']:
                    if int(node['id']) == int(link['source']):
                        refNode['source'] = node
                    if int(node['id']) == int(link['target']):
                        refNode['target'] = node
            if int(link['id']) == int(arr['target']):
                for node in graph['nodes']:
                    if int(node['id']) == int(link['source']):
                        tarNode['source'] = node
                    if int(node['id']) == int(link['target']):
                        tarNode['target'] = node
        angle['l' + str(n) + 'c' + str(i)] = AngleDifLink(refNode,tarNode)
        edgeTarRef['l' + str(n) + 'c' + str(i) + 'ref'] = toMili(Distance(float(refNode['source']['X']), float(refNode['source']['Y']), float(refNode['target']['X']), float(refNode['target']['Y'])))
        edgeTarRef['l' + str(n) + 'c' + str(i) + 'tar'] = toMili(Distance(float(tarNode['source']['X']), float(tarNode['source']['Y']), float(tarNode['target']['X']), float(tarNode['target']['Y'])))
        distance['l' + str(n) + 'c' + str(i)] = Line2line(refNode,tarNode)

